import React, { useState, useEffect } from "react";
import {
  StyleSheet,
  View,
  Text,
  TouchableOpacity,
  FlatList,
  Picker,
  Modal,
  ScrollView,
} from "react-native";
import { Avatar, Button, SearchBar, Input } from "react-native-elements";
import { auth } from "../../firebase";

const initialExercise = { name: "", sets: "", reps: "" };

const ExerciseInput = ({ title, value, onChangeText, pickerValue, onPickerChange }) => (
  <View style={styles.exerciseContainer}>
    <Text style={styles.formSubtitle}>{title}</Text>
    <Input placeholder="Exercise Name" onChangeText={onChangeText} value={value} />

    <Text>Sets</Text>
    <Picker selectedValue={pickerValue.sets} onValueChange={(value) => onPickerChange('sets', value)}>
      {Array.from({ length: 20 }, (_, i) => (
        <Picker.Item key={i} label={(i + 1).toString()} value={i + 1} />
      ))}
    </Picker>

    <Text>Reps</Text>
    <Picker selectedValue={pickerValue.reps} onValueChange={(value) => onPickerChange('reps', value)}>
      {Array.from({ length: 20 }, (_, i) => (
        <Picker.Item key={i} label={(i + 1).toString()} value={(i + 1).toString()} />
      ))}
    </Picker>
  </View>
);

export default function DoctorProfile({ navigation }) {
  const [userList, setUserList] = useState([
    { id: 1, name: 'User 1', medicalCondition: 'Condition 1', email: 'user1@example.com' },
    { id: 2, name: 'User 2', medicalCondition: 'Condition 2', email: 'user2@example.com' },
    // Add more users here
  ]);

  const [search, setSearch] = useState("");
  const [filteredUserList, setFilteredUserList] = useState(userList);

  const [isCreateWorkoutModalVisible, setCreateWorkoutModalVisible] = useState(false);
  const [newWorkout, setNewWorkout] = useState({
    workoutName: "",
    date: "",
    exercises: Array.from({ length: 4 }, () => ({ ...initialExercise })),
  });

  const handleSignOut = () => {
    auth
      .signOut()
      .then(() => {
        navigation.navigate("LoginScreen");
      })
      .catch((err) => alert(err.message));
  };

  const openCreateWorkoutModal = () => {
    setCreateWorkoutModalVisible(true);
  };

  const closeCreateWorkoutModal = () => {
    setCreateWorkoutModalVisible(false);
  };

  const createWorkout = () => {
    if (newWorkout.workoutName && newWorkout.date) {
      console.log("New Workout:", newWorkout);
      closeCreateWorkoutModal();
    }
  };

  useEffect(() => {
    searchFilterFunction(search);
  }, [search]);

  const navigateToUserProfile = (user) => {
    navigation.navigate("ProfileScreen", { user });
  };

  const searchFilterFunction = (text) => {
    setSearch(text);
    const newData = userList.filter((item) => item.email.toUpperCase().includes(text.toUpperCase()));
    setFilteredUserList(newData);
  };

  const setNewWorkoutExercise = (index, field, value) => {
    setNewWorkout((prevWorkout) => {
      const updatedExercises = [...prevWorkout.exercises];
      updatedExercises[index][field] = value;
      return { ...prevWorkout, exercises: updatedExercises };
    });
  };

  return (
    <View style={styles.container}>
       <View style={styles.header}>
        <Avatar
          rounded
          size={120}
          icon={{ name: "person", type: "material" }}
          avatarStyle={styles.avatarStyle}
          activeOpacity={0.7}
        />
        <Text style={styles.emailText}>{auth.currentUser?.email}</Text>
      </View>

      <View style={styles.buttonsContainer}>
        <Button
          type="solid"
          containerStyle={styles.buttonContainer}
          buttonStyle={styles.changePictureButton}
          titleStyle={styles.buttonTitle}
          title="Change Picture"
          onPress={() => console.log("Change this picture!")}
        />

        <Button
          type="solid"
          containerStyle={styles.buttonContainer}
          buttonStyle={styles.editProfileButton}
          titleStyle={styles.buttonTitle}
          title="Edit Profile"
          onPress={() => navigation.navigate("EditProfileScreen")}
        />

        <Button
          type="solid"
          containerStyle={styles.buttonContainer}
          buttonStyle={styles.createWorkoutButton}
          titleStyle={styles.buttonTitle}
          title="Workout"
          onPress={openCreateWorkoutModal}
        />

        <Button
          type="solid"
          containerStyle={styles.buttonContainer}
          buttonStyle={styles.logOutButton}
          titleStyle={styles.buttonTitle}
          title="Log Out"
          onPress={handleSignOut}
        />
      </View>

      <SearchBar
        round
        searchIcon={{ size: 26 }}
        containerStyle={styles.searchContainer}
        inputContainerStyle={styles.searchInputContainer}
        placeholder="Search user by email"
        onChangeText={(text) => searchFilterFunction(text)}
        onClear={() => searchFilterFunction("")}
        value={search}
      />

      <View style={styles.tableContainer}>
        <FlatList
          data={filteredUserList}
          keyExtractor={(item) => item.id.toString()}
          renderItem={({ item }) => (
            <TouchableOpacity style={styles.tableRow} onPress={() => navigateToUserProfile(item)}>
              <Text style={styles.tableCell}>{item.name}</Text>
              <Text style={styles.tableCell}>{item.medicalCondition}</Text>
              <Text style={styles.tableCell}>{item.email}</Text>
            </TouchableOpacity>
          )}
        />
      </View>

      <Modal visible={isCreateWorkoutModalVisible} animationType="slide" transparent={true}>
        <View style={styles.modalContainer}>
          <ScrollView contentContainerStyle={styles.scrollContainer}>
            <View style={styles.formContainer}>
              <Text style={styles.formTitle}>Create Workout</Text>
              <Input
                placeholder="Workout Name"
                onChangeText={(text) => setNewWorkout({ ...newWorkout, workoutName: text })}
                value={newWorkout.workoutName}
              />
              <Input
                placeholder="Date"
                onChangeText={(text) => setNewWorkout({ ...newWorkout, date: text })}
                value={newWorkout.date}
              />

              <View style={styles.exercisesContainer}>
                {newWorkout.exercises.map((exercise, index) => (
                  <ExerciseInput
                    key={index}
                    title={`Exercise ${index + 1}`}
                    value={exercise.name}
                    onChangeText={(text) => setNewWorkoutExercise(index, 'name', text)}
                    pickerValue={exercise}
                    onPickerChange={(field, value) => setNewWorkoutExercise(index, field, value)}
                  />
                ))}
              </View>

              <Button
                buttonStyle={styles.submitWorkout}
                title="Submit Workout"
                onPress={createWorkout}
              />
              <Button
                buttonStyle={styles.cancelWorkout}
                title="Cancel"
                onPress={closeCreateWorkoutModal}
              />
            </View>
          </ScrollView>
        </View>
      </Modal>
    </View>
  );
}
